import React, { Component } from 'react';
import { Card, Col, Row } from 'reactstrap';
import { Provider } from 'react-redux'
import { createStore } from "redux";
import RoomReducer from "../../reducer/RoomReducer";
import RoomTable from "./RoomTable";
import RoomDetail from './RoomDetail';
import { HashRouter, Route, Switch, withRouter } from 'react-router-dom';


export default class Room extends Component {
  render() {
    const roomStore = createStore(RoomReducer)
    return (
      <div className="animated fadeIn">
        <Provider store={roomStore}>
          <Row>
            <Col>
              <Card>
                <RoomTable />
                <Switch>
                  <Route exact path="/room" name="Login Page" render={props => <RoomTable {...props} />} />
                  <Route path="/room/detail" name="Register Page" render={props => <RoomDetail {...props} />} />
                </Switch>
              </Card>
            </Col>
          </Row>
        </Provider>
      </div>
    );
  }
}
